import React, { Component } from 'react'
import "../../styles/personalInfo/personalInfo.scss"
export default class PersonalInfo extends Component {
    constructor(props) {
        super(props);
    }
    redirect() {
        if (!this.props.redirectURL) return console.log("redirect !")
    }
    render() {
        return (

            <div className="tableWrapper">
                {/* <div className="title">
                        {this.props.columnHearder.map((headerName, title) => {
                            return <p className="element" key={title}>{headerName}</p>
                        })}
                    </div> */}
                <div className="data">
                    {this.props.rowData.map(dataRow => {
                        var profileData = "";
                        console.log("Data in row " + JSON.stringify(dataRow))


                        dataRow.map(cellData => {
                            console.log("cell data      ---> " + cellData)
                            return <p className="element"> {profileData = cellData}</p>
                        }

                        )
                        return profileData;

                    })}
                </div>
            </div>

        );
    }
}
